svg.script:

    function getChildElementById(childNodes, id){
      for(var i=0;i < childNodes.length;i++){
         var node = childNodes[i];
         if (node.id == id) return node;
      }
      return null;
    }
    function styleFontSizebyRadius(r, size){
      var size2 = r/100*size;
      return "font-family:Arial;font-size:"+size2+";stroke:black;fill:black;"
    }
    function setValuesFor2(id, ra, rb, tx1,tx2,tx3,tx4,tx5) {
       setValuesFor(id+"a", ra, tx1,tx2,tx3,tx4,tx5);
       setValuesFor(id+"b", rb, tx1,tx2,tx3,tx4,tx5);
    }
    function setValuesFor(id, r, tx1,tx2,tx3,tx4,tx5) {
      var elem = document.getElementById(id);
      var circle = getChildElementById(elem.childNodes, 'c1');
      circle.setAttribute("r", r);

      var t1 = getChildElementById(elem.childNodes, 't1');
      t1.innerHTML = tx1;
      t1.setAttribute("y", -0.75*r);
      t1.setAttribute("style", styleFontSizebyRadius(r, 72));

      var t2 = getChildElementById(elem.childNodes, 't2');
      t2.innerHTML = tx2;
      t2.setAttribute("style", styleFontSizebyRadius(r, 24));

      var t3 = getChildElementById(elem.childNodes, 't3');
      t3.innerHTML = tx3;
      t3.setAttribute("x", -0.67*r);
      t3.setAttribute("y", 0.67*r);
      t3.setAttribute("style", styleFontSizebyRadius(r, 32));

      var t4 = getChildElementById(elem.childNodes, 't4');
      t4.innerHTML = tx4;
      t4.setAttribute("x", 0.67*r);
      t4.setAttribute("y", 0.67*r);
      t4.setAttribute("style", styleFontSizebyRadius(r, 32));

      lowerhalf = document.getElementById("lowerhalf_"+id);
      var r2 = 2*r;
      lowerhalf.setAttribute("d", "M-"+r+",0 a"+r+","+r+" 0 0,0 "+r2+",0");//M-100,0 a100,100 0 0,0 200,00
      var t5 = getChildElementById(elem.childNodes, 't5');
      t5.setAttribute("style", styleFontSizebyRadius(r, 11));

      var t5path = getChildElementById(t5.childNodes, 't5path');
      t5path.innerHTML = tx5;
    }
    function initiation() {
      var elem = document.getElementById('e1');
      var lower_text = "y o u r - o w n . o r g";

      setValuesFor2('k1', 44, 40, "40","mm","64x","42'",lower_text);
      setValuesFor2('k2', 44, 40, "32","mm","79x","40'",lower_text);
      setValuesFor2('k3', 44, 40, "26","mm","98x","34'",lower_text);
      setValuesFor2('k4', 40, 34, "20","mm","127x","25'",lower_text);
      setValuesFor2('k5', 39, 34, "15","mm","169x","19'",lower_text);
      setValuesFor2('k6', 39, 34, "12.4","mm","205x","16'",lower_text);
      setValuesFor2('k7', 39, 34, "9.7","mm","262x","12'",lower_text);
      setValuesFor2('k8', 39, 34, "6.4","mm","397x","8'",lower_text);
//2x3x 44/40 mm
//2x1x 40/34 mm
//2x4x 39/34 mm
//LX200 10" f/10 focus length = 2540mm
//Meade series 4000   mm  Magnification View angle
//Meade Super Plössl  6.4 397x  8'
